import react from "react";
import ReactDOM from "react-dom/client";
import "./style.css";
import one from "./assets/images/o"
const root = ReactDOM.createRoot(document.getElementById("root"));
// Navbar Component
function Navbar() {
  return (
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>
          <a href="#">Home |</a>
        </li>
        <li>
          <a href="#">Product |</a>
        </li>
        <li>
          <a href="#">About Us |</a>
        </li>
        <li>
          <a href="#">Contact Us |</a>
        </li>
      </ul>
    </nav>
  );
}
// Search Component
function Search() {
  return (
    <div className="searchbar">
      <input type="text" placeholder="Search" />
    </div>
  );
}
// Products Component
function Products() {
  return (
    <div className="products">
      <div className="box">
        <img src={one} alt="Img" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
    </div>
  );
}
root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
  </div>
);
